// src/alerts/scannerFeed.js
import { logSetup } from './setupLogger';

export const injectLiveSetup = (setup) => {
  logSetup({
    ...setup,
    timestamp: new Date().toISOString(),
    outcome: 'Pending',
    bot: true,
  });
};
